Опис:
Срочно! Цена актуальна только до 25 декабря! Первая регистрация! BMW X5 35i. Состояние идеал! По блокам ошибок нет. Развал в норме. Двигатель работает ровно. Коробка переключает без пинков. Заменено: - масло ДВС; - масло АКПП; - антифриз; - прокладки впускн. коллект., теплообменника, маслянного стакана. Комплектация - космос: 
- Спортивная АКПП; 
- контроль движения в полосе; 
- предупреджении о препятствии; 
- распознавание дорожных знаков; 
- система кругового обзора; 
- обогрев руля; 
- комфортный доступ; 
- автодоводчик дверей; 
- Спортивный комплект - М стиль; 
- Спортивные Сиденья с подогревом, поясничной опорой, электрорегулировками и памятью; 
- Система обогрева задних сидений; 
- Дисплей на лобовом стекле; 
- Расширенная приборная панель Black Panel; 
- музыка HARMAN/KARDON; 
Реальному покупателю торг возле машины.
